import React, { useState } from 'react';
import { DndContext, closestCenter, useDroppable } from '@dnd-kit/core';
import { SortableContext, verticalListSortingStrategy, useSortable } from '@dnd-kit/sortable';
import { CSS } from '@dnd-kit/utilities';
import SortableShipToField from './SortableShipToField';

// Draggable Section Wrapper Component for Section 4
function DraggableSectionWrapper({ children, id, sectionNumber, isSectionHandleDragging = false, showDragHandle = true }) {
  const {
    attributes,
    listeners,
    setNodeRef,
    transform,
    transition,
    isDragging
  } = useSortable({ 
    id, 
    data: {
      type: 'section',
      sectionNumber: sectionNumber
    }
  });

  const style = {
    transform: CSS.Transform.toString(transform),
    transition,
    opacity: isDragging ? 0.6 : 1,
    zIndex: isDragging ? 1000 : 1,
    cursor: isDragging ? 'grabbing' : 'grab',
    position: 'relative',
    width: '100%',
    height: '100%',
    border: isDragging ? '3px solid #ff6b6b' : '2px solid #ddd',
    borderRadius: '8px',
    backgroundColor: isDragging ? 'rgba(255, 107, 107, 0.1)' : 'transparent'
  };

  return (
    <div 
      ref={setNodeRef} 
      style={style} 
      className={`sortable-section section-4 ${isDragging ? 'dragging' : ''}`}
      data-section={sectionNumber}
      data-testid={`draggable-section-${id}`}
      data-dragging={isDragging}
      {...attributes} 
      {...listeners}
    >
      <div 
        className="section-content"
        style={{ position: 'relative', width: '100%', height: '100%' }}
      >
        {children}
      </div>
    </div>
  );
}

function Section4ShipTo({ 
  shipToFields, 
  sensors, 
  onShipToDragEnd,
  onAddShipToField,
  onRemoveShipToField,
  onLabelChange,
  onContentChange,
  lastModified
}) {
  const [isPaletteOver, setIsPaletteOver] = useState(false);

  // Make the section droppable for palette fields
  const { isOver, setNodeRef } = useDroppable({
    id: 'section4',
    data: {
      type: 'section',
      sectionNumber: 4,
      accepts: 'palette-fields'
    }
  });

  // Update palette over state
  React.useEffect(() => {
    setIsPaletteOver(isOver);
  }, [isOver]);

  // Handler for adding new ship-to fields
  const handleAddField = () => {
    const newField = {
      id: `ship-to-field-${Date.now()}-${Math.random().toString(36).substr(2, 9)}`,
      label: 'New Field:',
      placeholder: 'Enter field value'
    };
    onAddShipToField(newField);
  };

  // Log field changes to console for tracking
  React.useEffect(() => {
    if (shipToFields.length > 0) {
      console.log('ðŸ”„ Ship To Fields Updated:', {
        totalFields: shipToFields.length,
        lastModified: new Date(lastModified).toLocaleString(),
        fields: shipToFields.map((field, index) => ({
          position: index + 1,
          id: field.id,
          label: field.label,
          placeholder: field.placeholder
        }))
      });
    }
  }, [shipToFields, lastModified]);

  return (
    <div 
      ref={setNodeRef}
      className={`section-4 ${isPaletteOver ? 'palette-over' : ''}`}
      data-palette-over={isPaletteOver}
    >
      {/* Section Header */}
      <div className="section-header">
        Section 4 - SHIP TO
        <span className="drag-indicator" style={{ 
          float: 'right', 
          opacity: 0.7, 
          fontSize: '12px',
          marginRight: '8px'
        }}>
          ::
        </span>
      </div>

      {/* Ship To Fields with Drag and Drop */}
      <DndContext 
        sensors={sensors}
        collisionDetection={closestCenter}
        onDragEnd={onShipToDragEnd}
      >
        <SortableContext 
          items={shipToFields.map(field => field.id)}
          strategy={verticalListSortingStrategy}
        >
          <div className="ship-to-fields-container">
            {shipToFields.map(field => (
              <SortableShipToField 
                key={field.id} 
                field={field} 
                onRemove={onRemoveShipToField}
                onLabelChange={onLabelChange}
                onContentChange={onContentChange}
                section="ship-to"
              />
            ))}
          </div>
        </SortableContext>
      </DndContext>

      {/* Add Field Button */}
      <div className="add-field-section">
        <button 
          className="add-field-btn" 
          onClick={handleAddField}
          title="Add new ship-to field"
        >
          +
        </button>
      </div>

      {/* Drop indicator when palette field is over */}
      {isPaletteOver && (
        <div className="drop-indicator">
          <div className="drop-message">
            âœ¨ Drop field here
          </div>
        </div>
      )}
    </div>
  );
}

export default Section4ShipTo;
